import React from 'react';
import logo from '../trainersPictures/logo.png';
import Why from './ Why'
import './Home.css'
import WhyUs from './Why';

const Home = () => {
    return (
     <>
     <div className="logo">
     <img src={logo} className="logoH"/>
     <h2>Fit<span className="rock">ROCK!</span></h2>
     </div>
    {WhyUs}
    </> );
}
 
export default Home;
